import React from "react";
import AnimationRevealPage from "helpers/AnimationRevealPage.js";
import tw from "twin.macro";
import styled from "styled-components"; //eslint-disable-line
import { css } from "styled-components/macro"; //eslint-disable-line
import Header from "components/headers/light.js";
import Footer from "components/footers/FiveColumnWithInputForm.js";
import MainFeature1 from "components/features/ServerCard.js";
// import MainFeature2 from "components/features/TwoColSingleFeatureWithStats.js";
// import MainFeature3 from "components/features/TwoColSingleFeatureWithStats2.js";
import Features from "components/features/ThreeColSimple.js";
// import Features from "components/features/ThreeColWithSideImage.js";
import TeamCardGrid from "components/cards/ProfileThreeColGrid.js";

import SupportIconImage from "images/support-icon.svg";
import ShieldIconImage from "images/shield-icon.svg";
import CustomerLoveIconImage from "images/simple-icon.svg";
import axios from "axios";

const baseURL = "http://localhost:1234/";

const Subheading = tw.span`uppercase tracking-wider text-sm`;
export default () => {
    const [post, setPost] = React.useState(null);

    React.useEffect(() => {
        axios.get(baseURL).then((response) => {
            console.log(response.data)
            setPost(response.data);
        });
    }, []);

    /*if (!post) return (
        <div>
            <h1>Waiting on response from Status-Checker...</h1>
            <h1>If this doesn't go away within 10 seconds, pls message Ian urgently!</h1>
        </div>
    )
    else if (post.serverName == null) return (
        <div>
            <h1>Ark Server on {baseURL} is offline</h1>
            <p>{post}</p>
            <h1>Pls message Ian about this!</h1>
        </div>)
    else return (

            <div style={{
                margin: '10px',
                position: 'absolute', left: '50%',
                transform: 'translate(-50%',
                color: 'blue',
                //backgroundImage: 'url(' + 'https://ulisses-spiele.de/assets/img/10/T_US46104_0.JPG' + ')',
                border: '5px solid rgba(0, 0, 0, 1)'
            }}>
                <div style={{
                    margin: '50px'}}>
                    <h1>Ark Server: {post.serverName} is online!</h1>
                    <p>Game being played = {post.gameDescription}</p>
                    <p>on Map = {post.map}</p>
                    <p>{post.numberOfPlayers} / {post.maxNumberOfPlayers} player</p>
                    <a href={post.connectUrl + "123/"}>Click me to join the Server!</a>
                </div>
            </div>

        );*/

  return (
    <AnimationRevealPage>
        {!post
        ? <MainFeature1
                subheading={<Subheading>Server 1</Subheading>}
                heading="Waiting on response from Status-Checker...If this doesn't go away within 10 seconds, pls message Ian urgently!"
                description=""
                buttonRounded={false}
                primaryButtonText="See Portfolio"
                imageSrc="https://images.unsplash.com/photo-1519389950473-47ba0277781c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=768&q=80"
            />
        :
            post.serverName == null
                ? <div>
                        <h1>Ark Server on {baseURL} is offline</h1>
                        <p>{post}</p>
                        <h1>Pls message Ian about this!</h1>
                    </div>
                    : <MainFeature1
                    subheading={<Subheading>Server 1</Subheading>}
                    heading={"Ark Server: "+post.serverName+" is online!"}
                    description={"Game being played = "+post.gameDescription}
                    description2={"on Map = "+post.map}
                    description3={post.numberOfPlayers+" / "+post.maxNumberOfPlayers+" player"}
                    buttonRounded={false}
                    primaryButtonText="Join the Server!"
                    primaryButtonUrl={post.connectUrl+"123/"}
                    imageSrc="https://images.unsplash.com/photo-1519389950473-47ba0277781c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=768&q=80"
                /> /*<div style={{
                        margin: '10px',
                        position: 'absolute', left: '50%',
                        transform: 'translate(-50%',
                        color: 'blue',
                        //backgroundImage: 'url(' + 'https://ulisses-spiele.de/assets/img/10/T_US46104_0.JPG' + ')',
                        border: '5px solid rgba(0, 0, 0, 1)'
                    }}>
                        <div style={{
                            margin: '50px'}}>
                            <h1>Ark Server: {post.serverName} is online!</h1>
                            <p>Game being played = {post.gameDescription}</p>
                            <p>on Map = {post.map}</p>
                            <p>{post.numberOfPlayers} / {post.maxNumberOfPlayers} player</p>
                            <a href={post.connectUrl + "123/"}>Click me to join the Server!</a>
                        </div>
                    </div>*/

            }
      <MainFeature1
        subheading={<Subheading>Server 1</Subheading>}
        heading="Ark Server: {post.serverName} is online!"
        buttonRounded={false}
        primaryButtonText="See Portfolio"
        imageSrc="https://images.unsplash.com/photo-1519389950473-47ba0277781c?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=768&q=80"
      />
      <MainFeature1
        subheading={<Subheading>Our Vision</Subheading>}
        heading="We aim to disrupt the design space."
        buttonRounded={false}
        primaryButtonText="Contact Us"
        imageSrc="https://images.unsplash.com/3/doctype-hi-res.jpg?ixlib=rb-1.2.1&auto=format&fit=crop&w=768&q=80"
        textOnLeft={false}
      />
      <Features
        subheading={<Subheading>Our Values</Subheading>}
        heading="We follow these."
        description="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
        cards={[
          {
            imageSrc: SupportIconImage,
            title: "24/7 Support",
            description: "Lorem ipsum donor amet siti ceali placeholder text alipiscing elit sed do eiusmod temport"
          },
          {
            imageSrc: ShieldIconImage,
            title: "Strong Teams",
            description: "Lorem ipsum donor amet siti ceali placeholder text alipiscing elit sed do eiusmod temport"
          },
          {
            imageSrc: CustomerLoveIconImage,
            title: "Customer Satisfaction",
            description: "Lorem ipsum donor amet siti ceali placeholder text alipiscing elit sed do eiusmod temport"
          },
        ]}
        linkText=""
      />
      <TeamCardGrid 
        subheading={<Subheading>Our Team</Subheading>}
      />
      <Footer />
    </AnimationRevealPage>
  );
};
